body:
Makes the Xrm `object` available in the browser's `window` object (`window`, `parent`, `top`, etc.) by introducing a dedicated interface `XrmStatic` and extending the `Window` interface specified in `lib.d.ts`:

```
interface Window {
    Xrm: Xrm.XrmStatic;
}
```

The `XrmStatic` interface is added to the already existing `Xrm` module:

```
declare module Xrm {
    interface XrmStatic {
        Page: Page;
        Utiltiy: Utiltiy;
    }
    module Page {...}
    module Utility {...}
}
```

To make the `Xrm` object globally available (not as a property of `window`) the following declaration is best practice:

```
declare var Xrm: Xrm.XrmStatic;
```

Declaring a variable and a module with the same name works only if the module is a so-called non-instantiated module (see section 2.3 of the TypeScript 1.5 language specification for more details). The current implementation of the `Xrm` module contains enums and is therefore introduced to the declaration space.

In order to solve this problem, the present proposal extracts the enums `FormType`, `SaveMode`, `StageCategory`, `GridControlContext`, `ViewType` into a separate `XrmEnum` module, allowing the `Xrm` module to be non-instanciated:

```
module XrmEnums {
    export const enum FormType {...}
    export const enum ViewType {...}
}
```

This allows to keep almost the entire Library within the `Xrm` root and also having a type (`Xrm.XrmStatic`) that can be referenced.
